import React, { Component } from "react";
import Square from './Square';

class Card extends Component {
  render() {
  	var cardStyle = {
  		height: 700,
  		width: 600,
  		padding: 0,
  		backgroundColor: 'grey'
  	}
    return (
    	<div style={cardStyle}>
    		<Square />


    	</div>
    );
  }
}

export default Card	;
